import { combineReducers } from 'redux';
import itemReducer from './itemReducer';

const rootReducer = combineReducers({
  items: itemReducer,
  reviews: reviewReducer,
  qnas: qnaReducer,
  users: userReducer,
  carts: cartReducer
});

export default rootReducer;
